import * as React from 'react';
import {Container, Paper} from "@mui/material";
import Box from "@mui/material/Box";
import {useEffect} from "react";

async function list() {
    const endpoint = 'http://localhost:8080/person/getAll';
    const response = await fetch(endpoint);
    const data = await response.json();
    console.log(data.value);
    return data.value;
}

export default function Users() {
    const [users, setUsers] = React.useState(null)

    useEffect(() => {
        fetch("http://localhost:8080/person/getAll")
            .then(response => response.json())
            .then(data => setUsers(data))
            .catch(err => console.log(err))
    }, []);

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }

    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <div>
                        <button id="list" onClick={async () => {
                            const userList = await list();
                            setUsers(userList); // Обновляем состояние с полученными данными
                        }}>List
                        </button>
                        <div>
                            <u1>
                                {
                                    users.map((list, index) => (
                                        <li key={index}> {list.id} | {list.name} | {list.anotherName}</li>
                                    ))}
                            </u1>
                        </div>
                    </div>
                </Box>
            </Paper>
        </Container>
    );
}
